import React, { Component } from 'react'
import { CartProvider } from 'react-use-cart'
import Navbar from '../Navbar';

class Shopping extends Component {
    state = {
        product: []
    }
    componentDidMount() {
        axios.get('/Api.json')
            .then((item) => {
                this.setState(
                    {
                        product: item.data.products
                    }
                )
            })
    }
  render() {
    return (
      <CartProvider>
        <Navbar></Navbar>
        

      </CartProvider>
    )
  }
}

export default Shopping;
